import React from 'react';
import Line from './Charts/Line';
import LineRadar from './Charts/Area';
import RangeColumn from './Charts/RangeColumn';
import Pie from './Charts/Pie';
import Donut from './Charts/Donut';
import Pie2 from './Charts/Pie2';
import Candle from './Charts/Candle';
import Scatter from './Charts/Scatter';
import Mix from './Charts/Mix';
import '../App.css';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';
import { useRef } from 'react';
import { useReactToPrint } from "react-to-print";



export default function Dashboard() {
    const conponentPDF= useRef();

    const generatePDF = () => {

        const input = document.getElementById('report');
        html2canvas(input)
            .then((canvas) => {
                const imgData = canvas.toDataURL('image/png');
                const pdf = new jsPDF();
                pdf.addImage(imgData, 'JPEG', 1, 1);
                pdf.save("download.pdf");
            })
    }
    return (
        <>
            <button onClick={generatePDF}> export</button>
            <div id='report'>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <Line />
                </div>
                <br></br>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <LineRadar />
                </div>
                <br></br>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <RangeColumn />
                </div>
                <br></br>
                <div className='row'>

                    <div className='col '><div className='shadow p-3 mb-5 bg-white rounded'> <Pie /></div>
                    </div>
                    <div className='col'><div className='shadow p-3 mb-5 bg-white rounded'><Donut /></div></div>
                    <div className='col'><div className='shadow p-3 mb-5 bg-white rounded'><Pie2 /></div></div>
                </div>
                <br></br>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <Candle />
                </div>
                <br></br>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <Scatter />
                </div>
                <br></br>
                <div className='shadow p-3 mb-5 bg-white rounded'>
                    <Mix />
                </div>
            </div>
        </>
    )
}
